import axios from 'axios';

class Table extends Component {
    componentDidMount() {
        axios.get('http://192.168.1.62:8080/poc-0.0.1-SNAPSHOT/getMsg')
        .then(response => {
            console.log(response.data)
        })
        .catch((error) => {
            console.log(error);
        })
    }
    
      render(){
        return(
          <div>
       
            <h1>Shanu</h1>
          </div>
        )
      }
    }
    
 export default Table;
